const type1 = $json.checks?.type1;                                                                 

if (type1) {
  const MIN_DETECTIONS = 3;
  type1.threshold_passed = type1.passed;

  const zones = $json.track_state?.zones || $json.zones;
  const checkedZones = type1.zones_checked || [];
  const validZones = [];

  if (zones && checkedZones.length > 0) {
    for (const zoneId of checkedZones) {
      let detectionCount = 0;
      if (type1.check_target === 'history') {
        const entries = (zones.history || []).filter(z => z.zone_id === zoneId);
        detectionCount = Math.max(0, ...entries.map(e => e.detection_count || 0));
      } else {
        detectionCount = zones.active?.[zoneId]?.detection_count || 0;
      }
      if (detectionCount >= MIN_DETECTIONS) {
        validZones.push(zoneId);
      }
    }
  }

  type1.passed = validZones.length > 0;
  type1.matching_zones = validZones;
  type1.matching_zone_count = validZones.length;
  if (validZones.length === 0 && checkedZones.length > 0) {
    type1.reason = 'insufficient_detections';
  }
}

return $input.item;
